import React from 'react' 

export const Notes = ({notes}) => {
    return (
        <ul className="list-group">
            {notes.map(note =>
            <li 
            className="list-group-item note"
            key={notes.id}
            ><strong>{notes.title}</strong>
                <button type="button" class="btn btn-outline-danger btn-sm">&times;</button>
            </li>
                )}

        </ul>
    )
}
